import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import { withRouter } from "react-router-dom";
import { NavBar, NavItem} from 'react-materialize';

class Navbar extends Component {
  constructor(props) {
    super(props);
  }
  logout(e) {
    e.preventDefault();
    this.props.logMeOut();
  }

  render() {

      if(this.props.user) {
        return (
          <nav>
            <NavLink to={"/"} className="jakku-logo"><img src="../../img/boxMapIcon.png" alt="Box image logo"/><h1>Jakku</h1> </NavLink>
            <img src="../../img"></img>
             <ul>
               <li>
               <NavLink to={"/profile"} className="profile-container">{this.props.user.username}<img src={this.props.user.imgPath} alt="User profile image"/>
               </NavLink>
               </li>

               <li><div onClick={e=>this.logout(e)}>Logout</div></li>
               <li>menu</li>
             </ul>
          </nav>
        )
      }
      else {
        return (
          <nav>
          <NavLink to={"/"} className="jakku-logo"><img src="../../img/box.svg" alt="Box image logo"/><h1>Jakku</h1> </NavLink>

           <ul>
             <li>
             <NavLink to={"/login"} className="profile-container">Acceder
             </NavLink>
             </li>
             <li>menu</li>
           </ul>
        </nav>

        )

      }



  }
}
export default withRouter(Navbar);
